import React from 'react';

const Footer = () => {
    return (
        <div>
            <footer className='bg-dark'>
                <div className='m-5 bg-dark'>
                    <p>Hllo</p>
                </div>
            </footer>
           
        </div>
    );
}

export default Footer;
